get.description:
The operation is used to get the parsing status and the link to the result in case of successful parsing. 

The customer has to specify the following information when creating a GET request :
- Customer will send the GET query with the unique Id, which is received by customer in the POST query . 
- After unique Id validation, it will send the parsing status (In Progress/Failed)
- Trip Parser will send the error message to API Customer in the case of unique  Id validation failure. 
- In the case of Parsing success then it will send the  URI to get the complete trip details 
- Trip Parser will send the error message to the customer in the case of trip creation failure or any other internal error . 

#### Response when Parsing is In progress Example:

``` json
{
    "data": {
        "type": "trip-parser-job",
        "id": "JKKSJNMSKHJ",
        "status": "IN_PROGRESS",
        "self": {
            "href": "https://test.api.amadeus.com/v2/travel/trip-parser-jobs/JKKSJNMSKHJ",
            "methods": [ "GET" ]
        }
    }
}
```

#### Successful Reply Example: 

``` json
{
    "data": {
        "type": "trip-parser-job",
        "id": "JKKSJNMSKHJ",
        "status": "COMPLETED",
        "result": {
            "href": "https://result-url",
            "methods": [ "GET" ]
        },
        "self": {
            "href": "https://test.api.amadeus.com/v2/travel/trip-parser-jobs/JKKSJNMSKHJ",
            "methods": [ "GET" ]
        }
    }
}
```

#### Reply when parsing is failed: 

``` json
{
    "data": {
        "type": "trip-parser-job",
        "id": "JKKSJNMSKHJ",
        "status": "FAILED",
        "detail": "Unable to parse",
        "self": {
            "href": "https://test.api.amadeus.com/v2/travel/trip-parser-jobs/JKKSJNMSKHJ",
            "methods": [ "GET" ]
        }
    }
}
```

#### Successful Reply with warnings returned:

``` json
{
    "data": {
        "type": "trip-parser-job",
        "id": "JKKSJNMSKHJ",
        "status": "COMPLETED",
        "result": {
            "href": "https://result-url",
            "methods": [ "GET" ]
        },
        "self": {
            "href": "https://test.api.amadeus.com/v2/travel/trip-parser-jobs/JKKSJNMSKHJ",
            "methods": [ "GET" ]
        }
    },
    "warnings": [
        {
        "code": 367,
        "title": "PARTIALLY PROCESSED"
        }
    ]
}
```

** warnings codes**

code    | title                                 
------- | ------------------------------------- 
 367    | PARTIALLY PROCESSED

- The operation is used to get the complete result of parsing as a aggregated view of Trip.
- The customer has to provide the job id in the GET request.
- System will verify the request and send the complete parsed trip with all the available segments information.
- Parsing system will send the error message in the case of any issue or error. 

